import React, { useState } from 'react'
import { Form, Tabs, Input, Select, Col, Row, Button, Modal, Tag, Slider, InputNumber } from 'antd'
import { SearchOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';

import './Miempresa/Miempresa-edit.scss'


export default function Miempresa() {
    
    const { TabPane } = Tabs;

    const tabs = ['1',"2"];
    const [Active, setActive] = useState(tabs[0]);

    const changeActive = () => {
        if(Active === "1"){
            setActive(tabs[1]);
        }else{
            setActive(tabs[0]);
        }
    }


    return (
        <>
        <Tabs  className="tab" activeKey={Active}  onChange={changeActive}  type="card">
            <TabPane className="tabPane" tab="Estructura" key="1">
                <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
                  <Col className="gutter-row" span={12}></Col>
                  <Col className="dividerLeft gutter-row" span={12}></Col>
                </Row>
                
            </TabPane>
            <TabPane  className="tabPane" tab="Puesto" key="2">
               
            </TabPane>
        </Tabs>

        
       </>
       
    )
}
